import React, { useState } from 'react'
import request from '../libs/request'
import List from '../components/List'

const Main = (props) => {
    const [list, setList] = useState([])
    useEffect(async() => {
        setList(await request.getArticles);
    });
    return (
        <List list={list}/>
    )
}
